import React from 'react';

const person = (props) => {
    return (
        <div class='Person'>    
            <p onClick={props.click}>I'm {props.name} and I am {props.age} years!</p>
            <p>{props.children}</p>
            <input type="text" onChange={props.changed} value={props.name} />

        </div>
    )
};

export default person;
